create table dbo.carts
(
    id                 bigint identity
        primary key,
    created_at         datetime default getdate() not null,
    user_id            bigint                     not null
        references dbo.users
            on delete cascade,
    product_variant_id bigint                     not null
        references dbo.product_variants,
    quantity           int      default 0         not null
)
go

CREATE TRIGGER check_quantity_and_update
ON carts
INSTEAD OF INSERT
AS
BEGIN
    DECLARE @new_quantity INT, @old_quantity INT, @variant_quantity INT, @user_id BIGINT, @variant_id BIGINT

    SELECT @new_quantity = quantity, @user_id = user_id, @variant_id = product_variant_id FROM inserted

    SELECT @old_quantity = quantity FROM carts WHERE user_id = @user_id AND product_variant_id = @variant_id

    SELECT @variant_quantity = quantity FROM product_variants WHERE id = @variant_id

    IF (@old_quantity IS NULL)
    BEGIN
        IF (@new_quantity > @variant_quantity)
        BEGIN
            RAISERROR ('The quantity in the cart cannot be larger than the quantity of the product variant.', 16, 1);
            ROLLBACK TRANSACTION;
            RETURN 
        END
        ELSE
        BEGIN
            INSERT INTO carts (user_id, product_variant_id, quantity) VALUES (@user_id, @variant_id, @new_quantity)
        END
    END
    ELSE
    BEGIN
        SET @new_quantity = @old_quantity + @new_quantity

        IF (@new_quantity > @variant_quantity)
        BEGIN
            RAISERROR ('The total quantity in the cart cannot be larger than the quantity of the product variant.', 16, 1);
            ROLLBACK TRANSACTION;
            RETURN 
        END
        ELSE
        BEGIN
            UPDATE carts SET quantity = @new_quantity WHERE user_id = @user_id AND product_variant_id = @variant_id
        END
    END
END;
go

create table dbo.invoices
(
    id                bigint identity
        primary key,
    created_at        datetime default getdate() not null,
    user_id           bigint                     not null
        references dbo.users
            on delete cascade,
    first_name        nvarchar(255)              not null,
    last_name         nvarchar(255)              not null,
    phone             varchar(255)               not null,
    address           nvarchar(255)              not null,
    transport_unit_id bigint   default 1         not null
        references dbo.transport_units,
    discount          int      default 0         not null,
    message           nvarchar(255),
    status            bigint   default 2         not null
        references dbo.invoice_states,
    payment_status    bit      default 0         not null,
    user_canceled     bit      default 0         not null,
    email             varchar(255)               not null
)
go

create table dbo.invoice_details
(
    id                 bigint identity
        primary key,
    created_at         datetime default getdate() not null,
    invoice_id         bigint                     not null
        references dbo.invoices
            on delete cascade,
    product_variant_id bigint                     not null
        references dbo.product_variants,
    quantity           int      default 0         not null
)
go

create table dbo.rates
(
    id         bigint identity
        primary key,
    created_at datetime default getdate() not null,
    user_id    bigint                     not null
        references dbo.users,
    product_id bigint                     not null
        references dbo.products,
    point      int                        not null,
    comment    nvarchar(255)
)
